import os
import re

from datetime import date


def camel_case(text):
    components = text.split(' ')
    return components[0].lower() + "".join(x.capitalize() for x in components[1:])


def kebab_case(text):
    s1 = re.sub('(.)([A-Z][a-z]+)', r'\1-\2', camel_case(text))
    return re.sub('([a-z0-9])([A-Z])', r'\1-\2', s1).lower()


